        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](13, "h3");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](14, "Introduction:");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](15, "p", 8);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](16, " A hobby is one\u2019s favorite habit, activity, or what a person chooses to do or what the person does usually for enjoyment and pleasure in his/her available leisure time. Having a hobby is a very good thing that can be developed at a point in one\u2019s life from childhood all the way to adulthood but it is sometimes best to have a hobby from childhood. We all participate in some kind of activity in line with our interests that we derive joy and happiness from; this activity is our hobby. We all have different hobbies based on our interests, dislikes, and likes.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](17, "hr", 9);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](18, "h3");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](19, "Types of Hobbies:");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](20, "p", 8);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](21, " There are a lot of different types of hobbies that we can show interest in and develop, examples of hobbies are singing, dancing, playing outdoor or indoor games, drawing, collecting antiques, bird watching, writing, photography, reading, eating, playing, sports, music, gardening, cooking, watching TV, talking and any other activity you can think of. Our different hobbies that become a source of earning money and a means of livelihood and we can build a very successful career out of our hobbies. A hobby is meant to be enjoyed in our leisure time but it can become a lot more than that. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](22, "hr", 9);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](23, "div", 10);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](24, "img", 11);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](25, "div", 6);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](26, "div", 7);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](27, "h3");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](28, "My Hobbies:");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](29, "p", 8);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](30, " One popular misconception is that we can have only one hobby; this is totally not true. As a child growing up, I loved and enjoyed cooking and I would spend hours watching cooking programmes and watching my parents cook. Sooner rather than later, I also started trying out different recipes and dishes I had seen on TV and sometimes even tweaked a few things and made delicacies of my own. Cooking gave my childhood so much joy and bliss which made it one of my hobbies, I could cook all day and I get just happy at the thought of trying out a new recipe. Another hobby of mine is soccer which is kind of an accidental hobby (if there is anything like that). ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](31, "p", 8);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](32, " I had always loved watching football (or soccer) and was pretty good at analysis and understanding of the game but I never really tried playing the sport because of my first hobby that is cooking which meant I was more of the indoor person. Fate would have it that one of my close friends was on the varsity soccer team and all the goalkeepers got injured so he told me about an open audition for the position of goalkeeper and I just decided to try out. I was wonderful at the try outs and got a spot on the varsity soccer team, I became a pretty brilliant goalkeeper and I look forward to every opportunity to get on the field of play. There is this feeling of fulfilment and satisfaction I get anytime I am on the field of play. It is very possible to have more than one hobby so open yourself to the possibilities of all the different activities and interesting things around us.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](33, "h3");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](34, "My Favourite Hobby:");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](35, "p", 8);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](36, " My favourite hobby is gardening. I spend most of my leisure time when I am not cooking or playing soccer in gardening. Gardening has been a huge source of knowledge, education, delight and entertainment to me. I have had the opportunity to learn a lot of new things on flowers, plants, vegetables, butterflies and even birds from gardening. My parents have a little plot of land where I pursue and practice this hobby. I have different varieties of vegetables, flowers and a few fruit trees in my garden. Some of the vegetables I grow are carrots, tomatoes, cauliflower, cabbage, spinach, radish, chillies, bitter gourd, etc. I also grow flowers like jasmine, roses, lilies, merry gold, carnation, poppies, flux and forget-me-not. These flowers make the garden a delight to behold and give the garden a soothing fragrance.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](37, "blockquote", 12);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelement"](38, "div");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](39, "p");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](40, " \" When a habbit begains to cost money, Its called a Hobby. \" ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](41, "footer");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](42, "cite");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](43, "Arti Ghosalkar");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](44, "p", 8);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](45, "There are a few fruit-trees in the garden including banana, mango, guava and pomegranate. The garden is visited often by quite a number of birds and there are even some birds are live permanently on the fruit trees. The chirping sound made by the birds and their sweet music gives the garden the perfect condition and makes it the ideal place to be. ");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](46, "p", 8);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](47, "Gardening has also helped my other hobby (soccer) by keeping me mentally alert, physically fit and very fresh. The ambience of the garden is highly invigorating, fresh and soothing; there is calmness to the atmosphere of the garden. The processes and activities involved in gardening include weeding, digging, grafting, cutting, maturing, watering and the tilling of the soil. All of these activities get me the needed physical exercise I need to make my body fit and keep me sharp mentally.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](48, "p", 8);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](49, "A lot of family members and friends appreciate my hobby gardening. Over the years, I have been able to develop skills needed in gardening, sometimes; my father also helps me maintain the garden. I have a worthy and wonderful collection of magazines and books on vegetables, flowers, fruit trees and also gardening overall. It is quite a wonderful experience to watch plants grow, develop and blossom.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](50, "p", 8);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](51, "I am not full of knowledge in gardening; sometimes, I get advice and help from a professional gardener so as to know the right thing to do. I spend a large chunk of my money purchasing manure, seeds, fertilisers, books on gardening and gardening tools and implements. I try to catch all the programmes on television about gardening, I visit plant and flower shows and also fruit and vegetable exhibition. I try my possible best to balance all my hobbies, studies and other engagements without hurting any one of them for the others.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](52, "p", 8);
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](53, "Gardening motivates me and gives me a sense of purpose about what I can achieve with my life. Once I am gardening, I forget about all of my worries, troubles and problems of the world. I am my happiest when I am working in the garden or when I get to give my friends and my family members fruits from the garden.");
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementEnd"]();
        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵelementStart"](54, "div", 13);
